import ExpenseItem from './ExpenseItem';
import './Expenses.css';

function Expenses(props)
{
    let expenses_render = [];
    expenses_render = props.expenses.map((e) => {
      return (
        <div className="expenses">
        <ExpenseItem
          id={e.id}
          date={e.date}
          title={e.title}
          amount={e.amount}
        ></ExpenseItem>
        </div>
      );
    });
  
    return (
      <div>
        {expenses_render}
      </div>
    );
}

export default Expenses;
